    true,nt"url": null,nt"notes": "The purpose of this exchange is to provide
    DoED with aggregate earnings data that will be used to measure compliance of Institutions
    of Higher Education with the Gainful Employment (GE) regulations effective July
    1, 2012. SSA uses existing Enumeration Verification System (EVS) and Earnings Coverage
    (EARN) software to verify the SSN and extract earnings data from the Master Earnings
    File (MEF). A back-end program computes the mean and median income for each GE program
    and earnings report year and provide DoED with an output file containing aggregate
    data. DoED uses SSA data to compute a debt to income ratio.",nt"license_title":
